import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Nav from './components/Nav';
import Home from './pages/Home'; // Предполагается, что у вас есть компонент Home
import About from './pages/About'; // Предполагается, что у вас есть компонент About
import Contact from './pages/Contact'; // Предполагается, что у вас есть компонент Contact

function App() {
  return (
    <Router>
      <Nav />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        {/* Добавьте дополнительные маршруты по мере необходимости */}
      </Routes>
    </Router>
  );
}

export default App;
